Investment Company of the People’s Republic of China (Singapore) Pte Ltd is a fully owned subsidiary of the People’s Bank of China. The company manages a part of foreign exchange reserve within the scope authorized by the People’s Bank of China, undertakes and transacts various kinds of investment businesses.

Job Description:
Work closely with the business for development of investment management functionalities, ensure the quality of deliverable for the work assigned;
Participate in the full RAD/Agile projects and also maintenance/ support post implementation;
Involved in analysis and scripting SQL queries for data analysis and data extraction, implement new regulatory changes, create new reports etc.;
Work with IT teams and senior management, regular reporting to management.
